import React, { Component } from 'react'
export default class Cinema extends Component {
    constructor(props){
        super(props)
        this.state={
            item:props.location.query.item,
        }
    }
    render() {
        return (
            <div>
                {this.props.location.query.item}
            </div>
        )
    }
}
